<!DOCTYPE html>
<html lang="en">
    <head>
        <meta charset="UTF-8">
        <meta name="viewport" content="width=device-width, initial-scale=1.0">
        <meta http-equiv="X-UA-Compatible" content="ie=edge">
        <!-- build:title -->
        <!--
            WebPack replaces this with a title tag containing the meta file's
            title value. The meta file (in src/meta/) is specified in
            config.yml.

        <!-- endbuild -->
        <!-- build:jatosjs -->
        <!-- If exported as a jatos study, WebPack will inject jatos.js here. -->
        <!-- endbuild -->
        <script src="js/jspsych.js"></script>
        <script src="js/app.js"></script>
        <!-- inject:css -->
        <!-- WebPack will inject css files here -->
        <!-- endinject -->
    </head>
    <body></body>
</html>
